import React from 'react';
import '../styles/Services.css';


function Services() {
  return (
    <section className="services" id="services">
      <h2>Our Services</h2>
      <div className="service-grid">
        <div className="service-card">
          <h3>Merchant Cash Advance</h3>
          <p>Access capital based on your future sales.</p>
        </div>
        <div className="service-card">
          <h3>Business Line of Credit</h3>
          <p>Flexible funding when you need it most.</p>
        </div>
        <div className="service-card">
          <h3>Startup Financing</h3>
          <p>Launch your new venture with a financial head start.</p>
        </div>
      </div>
    </section>
  );
}

export default Services;
